import React from "react";
import { NavLink } from "react-router-dom";
import {
  MDBContainer,
  MDBNavbar,
  MDBNavbarBrand
} from 'mdb-react-ui-kit';

function Header() {
  return (
    <MDBNavbar light bgColor='light'>
    <MDBContainer fluid>
      <MDBNavbarBrand href='#'>
        <img
          src='https://mdbootstrap.com/img/logo/mdb-transaprent-noshadows.webp'
          height='30'
          alt=''
          loading='lazy'
        />
        MDBootstrap
      </MDBNavbarBrand>
    </MDBContainer>
  </MDBNavbar>


  );
}

export default Header;
